import React, {Component,PureComponent} from 'react';
import viewStyle from './index.module.css';
import VisitorVolume from "./VisitorVolume";

class View extends Component {
    render() {
        const data = [
            {
                "name": "2021-04-21",
                "uv": 4000,
                "pv": 2400,
                "amt": 2400
            },
            {
                "name": "Page B",
                "uv": 3000,
                "pv": 1398,
                "amt": 2210
            },
            {
                "name": "Page C",
                "uv": 2000,
                "pv": 9800,
                "amt": 2290
            },
            {
                "name": "Page D",
                "uv": 2780,
                "pv": 3908,
                "amt": 2000
            },
            {
                "name": "Page E",
                "uv": 1890,
                "pv": 4800,
                "amt": 2181
            },
            {
                "name": "Page F",
                "uv": 2390,
                "pv": 3800,
                "amt": 2500
            },
            {
                "name": "Page G",
                "uv": 3490,
                "pv": 4300,
                "amt": 2100
            }
        ]
        return (
            <div className={viewStyle.box}>
                <h2 className={viewStyle.header}>企业管理数据魔墙</h2>
                <div className={viewStyle.left}>
                    <div className={viewStyle.view1}>
                        <h3 className={viewStyle.title}>站点流量</h3>
                        <VisitorVolume/>
                    </div>
                    <div className={viewStyle.view1}>
                        活跃数量
                    </div>
                    <div className={viewStyle.view1}>
                        活跃数量
                    </div>
                </div>
                <div className={viewStyle.center}>

                </div>
                <div className={viewStyle.right}>
                    <div className={viewStyle.view2}>
                        活跃数量
                    </div>
                    <div className={viewStyle.view2}>
                        活跃数量
                    </div>
                    <div className={viewStyle.view2}>
                        活跃数量
                    </div>
                </div>
                <div style={{clear:"both"}} />
            </div>
        );
    }
}

export default View;
